CREATE TABLE car_details(id SERIAL PRIMARY KEY NOT NULL,car_name VARCHAR NOT NULL,
brand VARCHAR NOT NULL,
model VARCHAR NOT NULL,
transmission_type VARCHAR NOT NULL,
fuel_type VARCHAR NOT NULL,
year INT NOT NULL,
price BIGINT NOT NULL,
distance_travel BIGINT NOT NULL,
exterior_colour VARCHAR NOT NULL,
interior_colour VARCHAR NOT NULL,
seating_capacity INT NOT NULL,
description VARCHAR NOT NULL,
finance VARCHAR NOT NULL,
why_buy_from_us VARCHAR NOT NULL,
warranty VARCHAR NOT NULL,
image1 VARCHAR NOT NULL DEFAULT 'data:image/webp;base64,',
image2 VARCHAR NOT NULL DEFAULT 'data:image/webp;base64,',
image3 VARCHAR NOT NULL DEFAULT 'data:image/webp;base64,',
image4 VARCHAR NOT NULL DEFAULT 'data:image/webp;base64,',
image5 VARCHAR NOT NULL DEFAULT 'data:image/webp;base64,',
isUsed BOOLEAN NOT NULL DEFAULT false
);
